        autoplay:true,
        speed: 100,
        swipeToSlide: true,
        autoplaySpeed:2000,
        slidesToShow:3,
        responsive:[
            {
                breakpoint: 992,
                settings: {
                    slidesToShow: 2,
                    slidesToSxroll:1,
